package com.qtz.sm.search.page;import com.mall.core.vo.Pager;/** * <p>Title:SearchListPage</p> * <p>Description:搜索列表分页类</p> * <p>Copyright: Copyright (c) 2016</p> * <p>Company: 深圳市擎天柱信息科技有限公司</p> * @author 郭云龙- 252735833@qq.com * @version v1.0 2016-06-06 */public class SearchPage extends Pager<com.qtz.sm.search.vo.Search,Long> implements java.io.Serializable{	/**类的版本号*/	private static final long serialVersionUID = 1694503164479480L;	/** 纬度 */	private Double latitude;	/** 经度 */	private Double longitude;	/** 关键字 */	private String keyword;	/** 搜索店铺ID，店内搜索时必须传入该值 */	private Long shopId;	/** 经营范围 */	private String scope;	public String getScope() {		return scope;	}	public void setScope(String scope) {		this.scope = scope;	}	public Double getLatitude() {		return latitude;	}	public void setLatitude(Double latitude) {		this.latitude = latitude;	}	public Double getLongitude() {		return longitude;	}	public void setLongitude(Double longitude) {		this.longitude = longitude;	}	public String getKeyword() {		return keyword;	}	public void setKeyword(String keyword) {		this.keyword = keyword;	}	public Long getShopId() {		return shopId;	}	public void setShopId(Long shopId) {		this.shopId = shopId;	}}